import React from 'react';
import classes from './UserList.module.css';
const UserList = (props) => {
    if(props.name.trim().length == 0 || props.age.trim().length == 0 ){
        return;
    }
    return(
        <div className={classes.users}>
           <ul>
                <li>{props.name}</li>
                <li>{props.age}</li>
            </ul>
        </div>
    )
}

export default UserList;
